                {
                    case "01":
                        TempReport1(document, writer);
                        break;
                    case "02":
                        CondensedClassReport(document, writer);
                        break;
                    case "03":
                        ParentList_Report(document, writer);
                        break;
                    case "04":
                        ParentList_Income_ExcludeReport(document, writer);
                        break;
                    case "05":
                        ParentList_Income_IncludeReport(document, writer);
                        break;
                    case "06":
                        ParentList_Income_AllMembers(document, writer);
                        break;
                    case "07":
                        ChildDisability_MedicalConditions_Report(document, writer);
                        break;
                    case "08":
                        ChildCareProgram_Report(document, writer);
                        break;
                    case "09":
                        CondensedName_Report(document, writer);
                        break;
                    case "10":
                        Transport_Report(document, writer);
                        break;
                }

                document.Close();
                fs.Close();
                fs.Dispose();
                AlertBox.Show("Report Generated Successfully");
                if (rbMailLbl.Checked && mstsnp_Labels.Count > 0)
                {
                    On_SaveLabelsReport(PdfName);
                }

            }
        }


