        public bool IsApplicant(MSTSNP_Entity Entity)
        {
            bool IsApp = true;

            string[] strArrayOne = strFundingCodes.Split(',');

            if (!string.IsNullOrEmpty(Entity.Enrl_Fund.Trim()))
            {
                string[] funds = Entity.Enrl_Fund.Trim().Split(',');
                string SelFund = string.Empty;
                for (int i = 0; i < funds.Length; i++)
                {
                    //var result = strArrayOne.Select(c => c.ToString().Equals(funds[i])).ToList();
                    //if (result[0] == false) { }
                    var result = strArrayOne.Where(x => x == funds[i]).FirstOrDefault();
                    if (result != null)
                        SelFund = SelFund + funds[i].Trim() + ",";

                    //if (strFundingCodes.Contains(funds[i].Trim()))
                    //    SelFund = funds[i].Trim() + ",";
                }

                if (!string.IsNullOrEmpty(SelFund.Trim()))
                {
                    Entity.Enrl_Fund = SelFund.Substring(0, SelFund.Length - 1);
                    IsApp = true;
                }
                else
                    IsApp = false;

            }
            else if (!string.IsNullOrEmpty(Entity.CHLDMST_FUND.Trim()))
            {
                var result = strArrayOne.Where(x => x == Entity.CHLDMST_FUND.Trim()).FirstOrDefault();

                //if (strFundingCodes.Contains(Entity.CHLDMST_FUND.Trim()))
                if (result != null)
                    IsApp = true;
                else
                    IsApp = false;

            }


            return IsApp;
        }

