        private void On_SaveExcelClosed_DevExpress(object sender, FormClosedEventArgs e)
        {
            PdfListForm form = sender as PdfListForm;
            if (form.DialogResult == DialogResult.OK)
            {
                #region FileNameBuild

                Random_Filename = null;
                string xlFileName = form.GetFileName();
                xlFileName = propReportPath + BaseForm.UserID + "\\" + xlFileName;
                try
                {
                    if (!Directory.Exists(propReportPath + BaseForm.UserID.Trim()))
                    {
                        DirectoryInfo di = Directory.CreateDirectory(propReportPath + BaseForm.UserID.Trim());
                    }
                }
                catch (Exception ex)
                {
                    CommonFunctions.MessageBoxDisplay("Error");
                }

                try
                {
                    string Tmpstr = xlFileName + ".xlsx";
                    if (File.Exists(Tmpstr))
                        File.Delete(Tmpstr);
                }
                catch (Exception ex)
                {
                    int length = 8;
                    string newFileName = System.Guid.NewGuid().ToString();
                    newFileName = newFileName.Replace("-", string.Empty);

                    Random_Filename = xlFileName + newFileName.Substring(0, length) + ".xlsx";
                }

                if (!string.IsNullOrEmpty(Random_Filename))
                    xlFileName = Random_Filename;
                else
                    xlFileName += ".xlsx";

                string _excelPath = xlFileName;

                #endregion

                dtCountTable = GetTable();
                SiteTable = GetTable();

                Workbook book = new Workbook();

                switch (((Captain.Common.Utilities.ListItem)cmbReport.SelectedItem).Value.ToString().Trim())
                {
                    case "01":
                        FullClassExcelReport01_DevExpress(xlFileName);
                        break;
                    case "02":
                        CondensedClassExcelReport_DevExpress(xlFileName);
                        break;
                    case "03":
                        ParentListExcelReport_DevExpress(xlFileName);
                        break;
                    case "04":
                        ParentListIncomeExcludeExcelReport_DevExpress(xlFileName);
                        break;
                    case "05":
                        ParentListIncomeIncludeExcelReport_DevExpress(xlFileName);
                        break;
                    case "06":
                        ParentListAllMembersExcelReport_DevExpress(xlFileName);
                        break;
                    case "07":
                        ChildDisabilityMedicalExcelReport_DevExpress(xlFileName);
                        break;
                    case "08":
                        ChildCareProgramExcelReport_DevExpress(xlFileName);
                        break;
                    case "09":
                        CondensedNameExcelReport_DevExpress(xlFileName);
                        break;
                    case "10":
                        TransportExcelReport_DevExpress(xlFileName);
                        break;
                }

            }
        }

