        #region DevExpress Condensed Class

        #region Excel Printing Function

        private void CondensedClassExcelReport_DevExpress(string strFileName)
        {

            string xlFileName = strFileName;

            if (Agency == "**")
                Agency = null;
            if (Depart == "**")
                Depart = null;
            if (Program == "**")
                Program = null;
            string Year = string.Empty;
            if (CmbYear.Visible == true)
                Year = ((Captain.Common.Utilities.ListItem)CmbYear.SelectedItem).Text.ToString().Trim();
            CaseEnrlEntity Search_Enrol = new CaseEnrlEntity(true);
            Search_Enrol.Agy = Agency;
            Search_Enrol.Dept = Depart;
            Search_Enrol.Prog = Program;
            Search_Enrol.Year = Year;
            Search_Enrol.Rec_Type = "H";

            CaseSiteEntity Sel_SiteList = new CaseSiteEntity();

            int _Rowindex = 0;
            int _Columnindex = 0;

            try
            {
                using (DevExpress.Spreadsheet.Workbook wb = new DevExpress.Spreadsheet.Workbook())
                {
                    DevExpress_Excel_Properties oDevExpress_Excel_Properties = new DevExpress_Excel_Properties();
                    oDevExpress_Excel_Properties.sxlbook = wb;
                    oDevExpress_Excel_Properties.sxlTitleFont = "calibri";
                    oDevExpress_Excel_Properties.sxlbodyFont = "calibri";

                    oDevExpress_Excel_Properties.getDevexpress_Excel_Properties();

                    #region Custom Styles

                    #endregion

                    ParametersPage(wb, oDevExpress_Excel_Properties);

                    #region Excel Report Data
                    int foot = 0;
                    DevExpress.Spreadsheet.Worksheet SheetDetails = null;

                    if (mstsnp_List.Count > 0)
                    {
                        if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "4" &&
                       ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "7" &&
                       ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "8" &&
                       ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "6" &&
                       ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "3" &&
                       ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "5")
                        {
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1")
                                SheetDetails = wb.Worksheets.Add("Condensed List (Child Name)");
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2")
                                SheetDetails = wb.Worksheets.Add("Condensed List (App#)");
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
                                SheetDetails = wb.Worksheets.Add("Condensed List (Parent Name)");

                            SheetDetails.ActiveView.TabColor = ColorTranslator.FromHtml("#ADD8E6");

                            SheetDetails.ActiveView.ShowGridlines = false;
                            wb.Unit = DevExpress.Office.DocumentUnit.Point;

                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1")
                                Condensed_Get_Column_Widths("1", SheetDetails);
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2")
                                Condensed_Get_Column_Widths("2", SheetDetails);
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
                                Condensed_Get_Column_Widths("9", SheetDetails);

                            _Rowindex = 0;
                            _Columnindex = 0;

                            SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 30;
                            _Columnindex++;

                            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Privileges.PrivilegeName.Trim().ToUpper();
                            oDevExpress_Excel_Properties.xlRowsMerge(SheetDetails, _Rowindex, _Columnindex, 7, oDevExpress_Excel_Properties.gxlFrameStyleL);
                            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 30;
                            _Columnindex = _Columnindex + 7;

                            SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 30;

                            _Rowindex++;
                            _Columnindex = 0;

                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1")
                                Condensed_Get_Column_Headers("1", SheetDetails, _Rowindex, _Columnindex, oDevExpress_Excel_Properties);
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2")
                                Condensed_Get_Column_Headers("2", SheetDetails, _Rowindex, _Columnindex, oDevExpress_Excel_Properties);
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
                                Condensed_Get_Column_Headers("9", SheetDetails, _Rowindex, _Columnindex, oDevExpress_Excel_Properties);

                        }

                        string PrivCity = string.Empty;
                        bool First = true;
                        bool site_empty = true;
                        string privSite = "Empty";
                        string Language = string.Empty;
                        bool IsApp = true;
                        mstsnp_Labels = new List<MSTSNP_Entity>();

                        var qlist = mstsnp_List.GroupBy(x => x.Site).Select(g => new { Site = g.Key, Count = g.Count() }).Where(x => x.Count == 1).ToList();

                        //var SRAMPMlist = mstsnp_List.GroupBy(x => x.Site, x=>x.Enrl_Room, x=>x).Select(g => new { Site = g.Key, Count = g.Count() }).Where(x => x.Count == 1).ToList();

                        var clist = mstsnp_List.GroupBy(x => x.City).Select(g => new { City = g.Key, Count = g.Count() }).Where(x => x.Count == 1).ToList();

                        int singleRecordCities = 0;
                        int singleRecordSites = 0;

                        foreach (MSTSNP_Entity Entity in mstsnp_List)
                        {
                            IsApp = true;

                            if (rbFundSel.Checked == true)
                            {
                                IsApp = IsApplicant(Entity);
                            }

                            if (IsApp)
                            {
                                mstsnp_Labels.Add(new MSTSNP_Entity(Entity));
                                string Enrl = string.Empty;

                                if (Entity.Enrl_Status == "E")
                                    Enrl = "Enrolled";

                                if (((Captain.Common.Utilities.ListItem)cmbEntlStat.SelectedItem).Value.ToString().Trim() == "B")
                                {
                                    TotalAppCount(Enrl, Entity.Classfication.Trim(), Entity.Repeat, Entity.CasecondApp, Entity.Diagnosis_Date, Entity.Sex, Entity.ChildAge, Entity.Ethinic, Entity.Race);
                                }
                                else if ((((Captain.Common.Utilities.ListItem)cmbEntlStat.SelectedItem).Value.ToString().Trim() == "E") && Enrl == "Enrolled")
                                {
                                    TotalAppCount(Enrl, Entity.Classfication, Entity.Repeat, Entity.CasecondApp, Entity.Diagnosis_Date, Entity.Sex, Entity.ChildAge, Entity.Ethinic, Entity.Race);
                                }
                                else if (((Captain.Common.Utilities.ListItem)cmbEntlStat.SelectedItem).Value.ToString().Trim() == "N" && Enrl != "Enrolled")
                                {
                                    TotalAppCount(Enrl, Entity.Classfication, Entity.Repeat, Entity.CasecondApp, Entity.Diagnosis_Date, Entity.Sex, Entity.ChildAge, Entity.Ethinic, Entity.Race);
                                }

                                if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "4")
                                {
                                    var lstsingleRecordCities = clist.Where(u => u.City == Entity.City.ToString() && u.Count == 1).ToList();
                                    singleRecordCities = lstsingleRecordCities.Count;

                                    if (Entity.City.Trim() != PrivCity)
                                    {
                                        #region Footer

                                        if (foot > 0)
                                        {
                                            _Rowindex++;
                                            _Columnindex = 0;

                                            SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                                            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                                            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 10;
                                            _Columnindex++;

                                            SheetDetails.Rows[_Rowindex][_Columnindex].Value = "2024 CAPSystems Inc";
                                            oDevExpress_Excel_Properties.xlRowsMerge(SheetDetails, _Rowindex, _Columnindex, 8, oDevExpress_Excel_Properties.gxlFrameFooterStyle);
                                            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 10;
                                            _Columnindex = _Columnindex + 8;

                                            SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                                            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                                            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 10;

                                            foot = 0;
                                        }

