        #region Condensed Get Common Columns

        private void Condensed_Get_Common_Column(MSTSNP_Entity Entity, DevExpress.Spreadsheet.Worksheet SheetDetails, int _Rowindex, int _Columnindex, DevExpress_Excel_Properties oDevExpress_Excel_Properties)
        {
            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.AppNo.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlNumb_DBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.Lname.Trim() + ", " + Entity.Fname.Trim() + " " + Entity.Mname.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            //SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.Lname.Trim();
            //SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
            //SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            //_Columnindex++;

            string HNo = string.Empty;
            string Street_Name = string.Empty;
            string Apt = string.Empty;
            string Flr = string.Empty;
            string zip = string.Empty;
            if (!string.IsNullOrEmpty(Entity.Hno.Trim()))
                HNo = Entity.Hno.Trim() + "  ";
            if (!string.IsNullOrEmpty(Entity.Street.Trim()))
                Street_Name = Entity.Street.Trim() + " " + Entity.Suffix.Trim() + "  ";
            if (!string.IsNullOrEmpty(Entity.Apt.Trim()))
                Apt = "Apt " + Entity.Apt.Trim() + "  ";
            if (!string.IsNullOrEmpty(Entity.Flr.Trim()))
                Flr = "Flr " + Entity.Flr.Trim() + "  ";
            if (Entity.ZipPlus.Trim() != "0" && Entity.ZipPlus.Trim() != "")
                zip = Entity.Zip.Trim() + ("-" + Entity.ZipPlus.Trim());
            else
                zip = Entity.Zip.Trim();

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = HNo + Street_Name + Apt + Flr + Entity.City.Trim() + " " + Entity.State.Trim() + " " + zip; //(Entity.Hno.Trim() + " " + Entity.Street.Trim());
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            //SheetDetails.Rows[_Rowindex][_Columnindex].Value = (Entity.City.Trim() + ", " + Entity.State.Trim());
            //SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
            //SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            //_Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = LookupDataAccess.Getdate(Entity.DOB.Trim());
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            MaskedTextBox msk_Phn = new MaskedTextBox();
            msk_Phn.Mask = "(999) 000-0000";
            if (!string.IsNullOrEmpty(Entity.Phone.Trim()))
                msk_Phn.Text = Entity.Phone.Trim();
            else
                msk_Phn.Mask = "";

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = msk_Phn.Text.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            string Classfication = string.Empty;
            if (Entity.Classfication == "98" || Entity.Classfication == "95")
            {
                Classfication = "Over Income";
            }

            if (!string.IsNullOrEmpty(Entity.G1_LName.Trim()) || !string.IsNullOrEmpty(Entity.G1_FName.Trim()))
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.G1_FName.Trim() + "  " + Entity.G1_LName.Trim();
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }
            else
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.G2_FName.Trim() + "  " + Entity.G2_LName.Trim();
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }

            string Repeater = string.Empty;
            string diagnosis_Date = string.Empty;

            if (Entity.Repeat.Trim() == "Y")
            {
                Repeater = "Repeater";
            }

            if (!string.IsNullOrEmpty(Entity.G1_LName.Trim()) || !string.IsNullOrEmpty(Entity.G1_FName.Trim()))
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.G2_FName.Trim() + "  " + Entity.G2_LName.Trim();
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }
            else
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }

            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }
        }

