        #region Condensed First Table Column Widths

        private void Condensed_Get_Column_Widths(string Sequence, DevExpress.Spreadsheet.Worksheet SheetDetails)
        {
            #region Column Widths

            SheetDetails.Columns[0].Width = 10;

