            {
                SheetDetails.Columns[1].Width = 80;
                SheetDetails.Columns[2].Width = 200;//150;
                //SheetDetails.Columns[3].Width = 150;
                SheetDetails.Columns[3].Width = 350;//200;
                //SheetDetails.Columns[5].Width = 150;
                SheetDetails.Columns[4].Width = 80;
                SheetDetails.Columns[5].Width = 90;
                SheetDetails.Columns[6].Width = 200;
                SheetDetails.Columns[7].Width = 200;
                SheetDetails.Columns[8].Width = 10;
            }

