                //SheetDetails.Columns[5].Width = 150;
                SheetDetails.Columns[4].Width = 80;
                SheetDetails.Columns[5].Width = 90;
                SheetDetails.Columns[6].Width = 200;
                SheetDetails.Columns[7].Width = 200;
                SheetDetails.Columns[8].Width = 80;//***Trans
                SheetDetails.Columns[9].Width = 10;
            }

            if (Sequence == "4")
            {
                SheetDetails.Columns[1].Width = 80;
                SheetDetails.Columns[2].Width = 200;//150;
                //SheetDetails.Columns[3].Width = 150;
                SheetDetails.Columns[3].Width = 350;//200;
                //SheetDetails.Columns[5].Width = 150;
                SheetDetails.Columns[4].Width = 80;
                SheetDetails.Columns[5].Width = 90;
                SheetDetails.Columns[6].Width = 200;
                SheetDetails.Columns[7].Width = 200;
                SheetDetails.Columns[8].Width = 140;//Child Address
                SheetDetails.Columns[9].Width = 10;
            }

            if (Sequence == "5")
            {
                SheetDetails.Columns[1].Width = 130;//Site Name
                SheetDetails.Columns[2].Width = 60;//App No
                SheetDetails.Columns[3].Width = 200;//120;//Child F Name
                //SheetDetails.Columns[4].Width = 120;//Child L Name
                SheetDetails.Columns[4].Width = 350;//180;//Address 1
                //SheetDetails.Columns[6].Width = 180;//Address 2
                SheetDetails.Columns[5].Width = 70;//DOB
                SheetDetails.Columns[6].Width = 80;//Phone No
                SheetDetails.Columns[7].Width = 200;//Parent/Guardian 1
                SheetDetails.Columns[8].Width = 200;//Parent/Guardian 2
                SheetDetails.Columns[9].Width = 50;//Site
                SheetDetails.Columns[10].Width = 50;//Room
                SheetDetails.Columns[11].Width = 50;//AM/PM/F
                SheetDetails.Columns[12].Width = 10;
            }

            #endregion
        }

