        #region  Child Care Program Placement List Get Common Columns

        private void ChildCare_Get_Common_Column(MSTSNP_Entity Entity, DevExpress.Spreadsheet.Worksheet SheetDetails, int _Rowindex, int _Columnindex, DevExpress_Excel_Properties oDevExpress_Excel_Properties, List<MembersEntity> Parent_List)
        {
            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.AppNo.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.Fname.Trim() + " " + Entity.Mname.Trim() + " " + Entity.Lname.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            string HNo = string.Empty;
            string Street_Name = string.Empty;
            string Apt = string.Empty;
            string Flr = string.Empty;
            string zip = string.Empty;
            if (!string.IsNullOrEmpty(Entity.Hno.Trim()))
                HNo = Entity.Hno.Trim() + "  ";
            if (!string.IsNullOrEmpty(Entity.Street.Trim()))
                Street_Name = Entity.Street.Trim() + " " + Entity.Suffix.Trim() + "  ";
            if (!string.IsNullOrEmpty(Entity.Apt.Trim()))
                Apt = "Apt " + Entity.Apt.Trim() + "  ";
            if (!string.IsNullOrEmpty(Entity.Flr.Trim()))
                Flr = "Flr " + Entity.Flr.Trim() + "  ";
            if (Entity.ZipPlus.Trim() != "0" && Entity.ZipPlus.Trim() != "")
                zip = Entity.Zip.Trim() + ("-" + Entity.ZipPlus.Trim());
            else
                zip = Entity.Zip.Trim();

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = HNo + Street_Name + Apt + Flr + Entity.City.Trim() + " " + Entity.State.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            string[] Edate = new string[] { };
            string[] datesEnrl = new string[] { };
            string EnrlDate = string.Empty;

            if (!string.IsNullOrEmpty(Entity.date_Enrl.Trim()))
            {
                Edate = Entity.date_Enrl.Trim().Split(',');

                for (int i = 0; i < Edate.Length; i++)
                {
                    if (string.IsNullOrEmpty(Edate[i].ToString()))
                        EnrlDate += "          ,";
                    else
                        EnrlDate += LookupDataAccess.Getdate(Edate[i].ToString()) + ",";

                }

                if (!string.IsNullOrEmpty(EnrlDate.Trim()))
                {
                    EnrlDate = EnrlDate.Substring(0, EnrlDate.Length - 1);
                    datesEnrl = EnrlDate.Trim().Split(',');
                }
                if (datesEnrl.Length > 0)
                {
                    SheetDetails.Rows[_Rowindex][_Columnindex].Value = LookupDataAccess.Getdate(datesEnrl[0].ToString().Trim());
                    SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
                    SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                    _Columnindex++;
                }
                else
                {
                    SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                    SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
                    SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                    _Columnindex++;
                }
            }
            else
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }

            string[] date = new string[] { };
            string[] datesFund = new string[] { };
            string EndDate = string.Empty;
            if (!string.IsNullOrEmpty(Entity.Enrl_fund_date.Trim()))
            {
                date = Entity.Enrl_fund_date.Trim().Split(',');

                for (int i = 0; i < date.Length; i++)
                {
                    if (string.IsNullOrEmpty(date[i].ToString()))
                        EndDate += "          ,";
                    else
                        EndDate += LookupDataAccess.Getdate(date[i].ToString()) + ",";
                }


                if (!string.IsNullOrEmpty(EndDate.Trim()))
                {
                    EndDate = EndDate.Substring(0, EndDate.Length - 1);
                    datesFund = EndDate.Trim().Split(',');
                }
                if (datesFund.Length > 0)
                {
                    SheetDetails.Rows[_Rowindex][_Columnindex].Value = LookupDataAccess.Getdate(datesFund[0].ToString().Trim());
                    SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
                    SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                    _Columnindex++;

                }
                else
                {
                    SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                    SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
                    SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                    _Columnindex++;
                }
            }
            else
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }

            string[] funds = new string[] { };
            string[] descFund = new string[] { };
            string Fund_Desc = string.Empty;
            if (!string.IsNullOrEmpty(Entity.Enrl_Fund.Trim()))
            {
                funds = Entity.Enrl_Fund.Trim().Split(',');
                for (int i = 0; i < funds.Length; i++)
                {
                    foreach (DataRow drFund in dtFund.Rows)
                    {
                        if (funds[i].Trim() == drFund["Code"].ToString().Trim())
                        {
                            Fund_Desc += drFund["LookUpDesc"].ToString().Trim() + ",";
                            break;
                        }
                    }
                }

                if (!string.IsNullOrEmpty(Fund_Desc.Trim()))
                {
                    Fund_Desc = Fund_Desc.Substring(0, Fund_Desc.Length - 1);
                    descFund = Fund_Desc.Trim().Split(',');

                    SheetDetails.Rows[_Rowindex][_Columnindex].Value = descFund[0].ToString();
                    SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
                    SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                    _Columnindex++;
                }
            }
            else
            {
                if (!string.IsNullOrEmpty(Entity.CHLDMST_FUND.Trim()))
                {
                    string Fund_Des = string.Empty;
                    foreach (DataRow drFund in dtFund.Rows)
                    {
                        if (Entity.CHLDMST_FUND.Trim() == drFund["Code"].ToString().Trim())
                        {
                            Fund_Des = drFund["LookUpDesc"].ToString().Trim();
                            break;
                        }
                    }
                    SheetDetails.Rows[_Rowindex][_Columnindex].Value = Fund_Des;
                    SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
                    SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                    _Columnindex++;
                }
                else
                {
                    SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                    SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
                    SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                    _Columnindex++;
                }
            }

            float month_Incm = (float.Parse(Entity.Fam_Income.Trim())) / 12;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = LookupDataAccess.GetAmountSep(month_Incm.ToString("0.00"));
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDeci_DBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = LookupDataAccess.GetAmountSep(Entity.Fam_Income.Trim());
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDeci_DBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            Parent_List = mem_List.FindAll(u => u.Agy.Equals(Entity.Agy) && u.Dept.Equals(Entity.Dept) && u.Prog.Equals(Entity.Prog) && u.Year.Trim().Equals(Entity.Year.Trim()) && u.AppNo.Equals(Entity.AppNo));

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = (Parent_List.Count + 1);
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlNumb_DBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            if (datesEnrl.Length > 1)
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = datesEnrl[1].ToString();
            }
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            if (datesFund.Length > 1)
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = datesFund[1].ToString();
            }
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            if (descFund.Length > 1)
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = descFund[1].ToString();
            }
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            if (datesFund.Length > 2 || descFund.Length > 2 || datesEnrl.Length > 2)
            {
                for (int i = 2; i < datesFund.Length; i++)
                {
                    if (!string.IsNullOrEmpty(datesEnrl[i].ToString().Trim()))
                    {
                        SheetDetails.Rows[_Rowindex][_Columnindex].Value = datesEnrl[i].ToString().Trim();

                    }
                    SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlNumb_DBCC_Blue_Borders;
                    SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                    _Columnindex++;

                    if (!string.IsNullOrEmpty(datesFund[i].ToString().Trim()))
                    {
                        SheetDetails.Rows[_Rowindex][_Columnindex].Value = datesFund[i].ToString();

                    }
                    SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlNumb_DBCC_Blue_Borders;
                    SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                    _Columnindex++;

                    if (!string.IsNullOrEmpty(descFund[i].ToString().Trim()))
                    {
                        SheetDetails.Rows[_Rowindex][_Columnindex].Value = descFund[i].ToString();

                    }
                    SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlNumb_DBCC_Blue_Borders;
                    SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                    _Columnindex++;
                }
            }

            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }
