        private void TransportExcelReport_DevExpress(string strFileName)
        {
            string xlFileName = strFileName;

            if (Agency == "**")
                Agency = null;
            if (Depart == "**")
                Depart = null;
            if (Program == "**")
                Program = null;
            string Year = string.Empty;
            if (CmbYear.Visible == true)
                Year = ((Captain.Common.Utilities.ListItem)CmbYear.SelectedItem).Text.ToString().Trim();
            CaseEnrlEntity Search_Enrol = new CaseEnrlEntity(true);
            Search_Enrol.Agy = Agency;
            Search_Enrol.Dept = Depart;
            Search_Enrol.Prog = Program;
            Search_Enrol.Year = Year;
            Search_Enrol.Rec_Type = "H";

            CaseSiteEntity Sel_SiteList = new CaseSiteEntity();

            List<MembersEntity> Parent_List = new List<MembersEntity>();

            int _Rowindex = 0;
            int _Columnindex = 0;

            try
            {
                using (DevExpress.Spreadsheet.Workbook wb = new DevExpress.Spreadsheet.Workbook())
                {
                    DevExpress_Excel_Properties oDevExpress_Excel_Properties = new DevExpress_Excel_Properties();
                    oDevExpress_Excel_Properties.sxlbook = wb;
                    oDevExpress_Excel_Properties.sxlTitleFont = "calibri";
                    oDevExpress_Excel_Properties.sxlbodyFont = "calibri";

                    oDevExpress_Excel_Properties.getDevexpress_Excel_Properties();

                    #region Custom Styles

                    #endregion

                    ParametersPage(wb, oDevExpress_Excel_Properties);

                    #region Excel Report Data
                    int foot = 0;
                    DevExpress.Spreadsheet.Worksheet SheetDetails = null;

                    if (mstsnp_List.Count > 0)
                    {
                        if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "4" &&
                       ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "7" &&
                       ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "8" &&
                       ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "6" &&
                       ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "3" &&
                       ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() != "5")
                        {
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1")
                                SheetDetails = wb.Worksheets.Add("Transport (Child Name)");
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2")
                                SheetDetails = wb.Worksheets.Add("Transport (App#)");
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
                                SheetDetails = wb.Worksheets.Add("Transport (Parent Name)");

                            SheetDetails.ActiveView.TabColor = ColorTranslator.FromHtml("#ADD8E6");

                            SheetDetails.ActiveView.ShowGridlines = false;
                            wb.Unit = DevExpress.Office.DocumentUnit.Point;

                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1")
                                Transport_Get_Column_Widths("1", SheetDetails);
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2")
                                Transport_Get_Column_Widths("2", SheetDetails);
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
                                Transport_Get_Column_Widths("9", SheetDetails);

                            _Rowindex = 0;
                            _Columnindex = 0;

                            SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 30;
                            _Columnindex++;

                            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Privileges.PrivilegeName.Trim().ToUpper();
                            oDevExpress_Excel_Properties.xlRowsMerge(SheetDetails, _Rowindex, _Columnindex, 12, oDevExpress_Excel_Properties.gxlFrameStyleL);
                            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 30;
                            _Columnindex = _Columnindex + 12;

                            SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 30;

                            _Rowindex++;
                            _Columnindex = 0;

                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1")
                                Transport_Get_Column_Headers("1", SheetDetails, _Rowindex, _Columnindex, oDevExpress_Excel_Properties);
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2")
                                Transport_Get_Column_Headers("2", SheetDetails, _Rowindex, _Columnindex, oDevExpress_Excel_Properties);
                            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
                                Transport_Get_Column_Headers("9", SheetDetails, _Rowindex, _Columnindex, oDevExpress_Excel_Properties);

                        }

                        string PrivCity = string.Empty;
                        bool First = true;
                        bool site_empty = true;
                        string Enrl = string.Empty;
                        string PrivSiteName = string.Empty, PrivStreet = string.Empty, PrivCityState = string.Empty;
                        string PrivPhn = string.Empty, PrivStarts = string.Empty, privEnds = string.Empty, privlang = string.Empty, privsitenumber = string.Empty,
                            privFund = string.Empty;
                        string PrivRoom = string.Empty;
                        string PrivAmPm = string.Empty;
                        string privSite = "Empty";
                        string Language = string.Empty;
