        #region Transportaion Get Common Columns

        private void Transport_Get_Common_Column(MSTSNP_Entity Entity, DevExpress.Spreadsheet.Worksheet SheetDetails, int _Rowindex, int _Columnindex, DevExpress_Excel_Properties oDevExpress_Excel_Properties)
        {
            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.AppNo.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.Lname.Trim() + ", " + Entity.Fname.Trim() + "  " + Entity.Mname.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = LookupDataAccess.Getdate(Entity.DOB.Trim());
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            string HNo = string.Empty;
            string Street_Name = string.Empty;
            string Apt = string.Empty;
            string Flr = string.Empty;
            string zip = string.Empty;
            if (!string.IsNullOrEmpty(Entity.Hno.Trim()))
                HNo = Entity.Hno.Trim() + "  ";
            if (!string.IsNullOrEmpty(Entity.Street.Trim()))
                Street_Name = Entity.Street.Trim() + " " + Entity.Suffix.Trim() + "  ";
            if (!string.IsNullOrEmpty(Entity.Apt.Trim()))
                Apt = "Apt " + Entity.Apt.Trim() + "  ";
            if (!string.IsNullOrEmpty(Entity.Flr.Trim()))
                Flr = "Flr " + Entity.Flr.Trim() + "  ";
            if (Entity.ZipPlus.Trim() != "0" && Entity.ZipPlus.Trim() != "")
                zip = Entity.Zip.Trim() + ("-" + Entity.ZipPlus.Trim());
            else
                zip = Entity.Zip.Trim();

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = HNo + Street_Name + Apt + Flr + " " + Entity.City.Trim() + " " + Entity.State.Trim() + " " + zip;
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            string Father = string.Empty;
            string ssn = string.Empty;

            if (!string.IsNullOrEmpty(Entity.G1_FName.Trim() + Entity.G1_LName.Trim()))
            {
                Father = Entity.G1_FName.Trim() + "  " + Entity.G1_LName.Trim();
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = Father;
            }
            else
            {
                Father = Entity.G2_FName.Trim() + "  " + Entity.G2_LName.Trim();
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = Father;
            }
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBLC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            string Phone_Number = string.Empty;
            ssn = LookupDataAccess.GetPhoneSsnNoFormat(Entity.G1_Phone.Trim()) + " ";
            Phone_Number = LookupDataAccess.GetPhoneSsnNoFormat(Entity.G2_Phone.Trim());

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = LookupDataAccess.GetPhoneSsnNoFormat(Entity.Phone.Trim());
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = ssn;
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Phone_Number;
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.Lang_Desc.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.Pickup.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = Entity.DropOff.Trim();
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
            SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlDBCC_Blue_Borders;
            SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
            _Columnindex++;

            string Classfication = string.Empty;

            if (((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "1" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "2" || ((Captain.Common.Utilities.ListItem)cmbSeq.SelectedItem).Value.ToString().Trim() == "9")
            {
                SheetDetails.Rows[_Rowindex][_Columnindex].Value = "";
                SheetDetails.Rows[_Rowindex][_Columnindex].Style = oDevExpress_Excel_Properties.gxlFrameStyleL;
                SheetDetails.Rows[_Rowindex][_Columnindex].RowHeight = 20;
                _Columnindex++;
            }
        }

